import React from 'react';
import { useDispatch } from 'react-redux';
import { useState, useEffect } from 'react';

const User = ({ userData }) => {
    // const [Email, setEmail] = useState('');
    // const [Password, setPassword] = useState('');
    const [status, setStatus] = useState(false);

    const Myfunction = () => {
        setStatus(true);
        console.log('!!!:', status);
    };

    const dispatch = useDispatch();

    useEffect(() => {
        console.log('!!!:', status);
        dispatch({
            type: 'CLEAR_USER_DATA',
        });
        dispatch({
            type: 'SET_USER_DATA',
            payload: true,
        });
    }, [status]);

    return (
        <div className="data">
            <button styles="justify-content: center; align-items: center" onClick={Myfunction}>
                버튼
            </button>
        </div>
    );
};

export default User;
